import { CiSearch } from "react-icons/ci";
import { AiOutlineDelete } from "react-icons/ai";

import {
    ChildContainer1,
    ChildContainer2,
    Container,
    Delete,
    GlobalStyle,
    Img,
    Input,
    PlayList,
    PlayListContainer,
    SearchIcon,
    SearchInputContainer,
    SongsHeader,
    Span,
} from "./styledComponents";
import { useState } from "react";

const initialTracksList = [
    {
        id: "3b22e3fd-3d12-4ad1-9e38-90314219c4f4",
        imageUrl:
            "https://assets.ccbp.in/frontend/react-js/music-playlist/music-playlist-perfect-img.png",
        name: "Perfect",
        genre: "Pop",
        duration: "4:04",
    },
    {
        id: "40f97965-ff45-469e-a635-b2ef9f1642ed",
        imageUrl:
            "https://assets.ccbp.in/frontend/react-js/music-playlist/music-playlist-shape-of-you-img.png",
        name: "Shape of You",
        genre: "Divide",
        duration: "4:24",
    },
    {
        id: "782f916b-4056-44ec-a95f-5115c3f84904",
        imageUrl:
            "https://assets.ccbp.in/frontend/react-js/music-playlist/music-playlist-visiting-hours.png",
        name: "Visiting Hours",
        genre: "Folk-Pop",
        duration: "3:49",
    },
    {
        id: "fcf0dc77-3427-457c-9ee0-91b1dc39fece",
        imageUrl:
            "https://assets.ccbp.in/frontend/react-js/music-playlist/music-playlist-shivers-img.png",
        name: "Shivers",
        genre: "Dance-Pop",
        duration: "3:58",
    },
    {
        id: "9c1bb890-d4d5-4edf-9d95-6959d716b442",
        imageUrl:
            "https://assets.ccbp.in/frontend/react-js/music-playlist/music-playlist-bad-habits-img.png",
        name: "Bad Habits",
        genre: "Dance-Pop",
        duration: "4:01",
    },
    {
        id: "2216db9c-647f-4814-b880-179740e4d748",
        imageUrl:
            "https://assets.ccbp.in/frontend/react-js/music-playlist/music-playlist-castle-on-the-hill-img.png",
        name: "Castle on the Hill",
        genre: "Pop&Rock",
        duration: "4:48",
    },
    {
        id: "a5e30966-b760-4660-bf08-073135f7d010",
        imageUrl:
            "https://assets.ccbp.in/frontend/react-js/music-playlist/music-playlist-happier-img.png",
        name: "Happier",
        genre: "Pop",
        duration: "3:36",
    },
    {
        id: "2d5c9bc0-b8b0-41c6-aa55-cb3b659d8604",
        imageUrl:
            "https://assets.ccbp.in/frontend/react-js/music-playlist/music-playlist-photograph-img.png",
        name: "Photograph",
        genre: "Folk music",
        duration: "4:26",
    },
    {
        id: "efd3d621-2c05-4941-acdc-0a1a0786bc53",
        imageUrl:
            "https://assets.ccbp.in/frontend/react-js/music-playlist/music-playlist-galway-girl-img.png",
        name: "Galway Girl",
        genre: "Pop",
        duration: "3:20",
    },
    {
        id: "e4b8e3b8-7776-4c09-8abc-ba328a8babe9",
        imageUrl:
            "https://assets.ccbp.in/frontend/react-js/music-playlist/music-playlist-i-dont-care-img.png",
        name: "I Don't Care",
        genre: "Pop",
        duration: "3:38",
    },
];

const App = () => {
    const [searchItem, setSearchItem] = useState("");
    const [trackList, setTrackList] = useState(initialTracksList);

    const handleDelete = (itemId) => {
        const updateList = trackList.filter((track) => track.id !== itemId);
        setTrackList(updateList);
    };
    const filterTrackList = trackList.filter(
        (item) =>
            item.name.toLowerCase().includes(searchItem.toLowerCase()) ||
            item.genre.toLowerCase().includes(searchItem.toLowerCase()) ||
            !searchItem
    );

    return (
        <>
            <GlobalStyle />
            <Container>
                <ChildContainer1>
                    <div>
                        <h1>Ed shareen</h1>
                        <Span>singer</Span>
                    </div>
                </ChildContainer1>
                <ChildContainer2>
                    <SongsHeader>
                        <h1>Songs Playlist</h1>
                        <SearchInputContainer>
                            <Input
                                type="text"
                                placeholder="search"
                                value={searchItem}
                                onChange={(e) => setSearchItem(e.target.value)}
                            />
                            <SearchIcon>
                                <CiSearch />
                            </SearchIcon>
                        </SearchInputContainer>
                    </SongsHeader>

                    <PlayListContainer>
                        {filterTrackList.map((item) => (
                            <PlayList key={item.id}>
                                <div
                                    style={{
                                        display: "flex",
                                        margin: "10px",
                                    }}
                                >
                                    <Img src={item.imageUrl} alt="hi" />
                                    <div
                                        style={{
                                            margin: "10px",
                                        }}
                                    >
                                        <h1>{item.name}</h1>
                                        <span
                                            style={{
                                                color: " #3b82f6",
                                                marginTop: "5px",
                                            }}
                                        >
                                            {item.genre}
                                        </span>
                                    </div>
                                </div>
                                <div
                                    style={{
                                        display: "flex",
                                        justifyContent: "center",
                                        alignItems: "center",
                                    }}
                                >
                                    <span>{item.duration}</span>
                                    <Delete onClick={handleDelete(item.id)}>
                                        <AiOutlineDelete size={20} />
                                    </Delete>
                                </div>
                            </PlayList>
                        ))}
                    </PlayListContainer>
                </ChildContainer2>
            </Container>
        </>
    );
};

// Exporting the App component
export default App;
